Button1.onClick:
var mapWidget = client.getWidget("map1");
var map = mapWidget.map;

 var drawingManager = new google.maps.drawing.DrawingManager(
 {
    drawingMode: google.maps.drawing.OverlayType.POLYGON,
    drawingControl: true,
    drawingControlOptions: 
   	{
      	position: google.maps.ControlPosition.TOP_CENTER,
      	//drawingModes: ['marker', 'circle', 'polygon', 'polyline', 'rectangle']
      	drawingModes: ['polygon']
    },

     circleOptions: {
         fillColor: '#ffff00',
         fillOpacity: 0.2,
         strokeWeight: 5,
         clickable: false,
         editable: true,
         zIndex: 1},

     polygonOptions: {
         fillColor: '#c8fe22',
         fillOpacity: 0.35,
         strokeWeight: 5,
         clickable: false,
         editable: true,
         zIndex: 1
     }
  });

drawingManager.setMap(map);

//
//	Listen for an event when the user completes the drawing of a polygon
//
google.maps.event.addListener(drawingManager, 'overlaycomplete', function(event) 
{
	switch (event.type) 
    {
		case google.maps.drawing.OverlayType.POLYGON:
            //
            //	Get the array of points in the polygon
            //
            var polyarray = event.overlay.getPath().getArray();  

            polyarray.forEach(function(item)
            {
               console.log(JSON.stringify(item));                   
            });                                
            break;
    }
});

