Button3.onClick:
var mapWidget = client.getWidget("map1");
var map = mapWidget.map;

//
//	Describe some known locations
//
var theHub = {lat: 33.812093, lng: -117.918973};
var spaceMountain  = {lat: 33.811170, lng: -117.917183};
var hauntedMansion = {lat: 33.811776, lng: -117.922101};

//
//	Describe an icon from a VANTIQ document
//
var rocketIcon = {
    url: client.getDocumentUrl("rocket.png"),
    scaledSize: new google.maps.Size(32, 32),	// Scale the image to 32x32
    anchor: new google.maps.Point(16,16) 		// The anchor for this image is the center
};

//
//	Describe an icon found on the net
//
var ghostIcon = {
    url: "http://icons.iconarchive.com/icons/icons8/halloween/256/ghost-icon.png",
    scaledSize: new google.maps.Size(32, 32),	// Scale the image to 32x32
    anchor: new google.maps.Point(16,16) 		// The anchor for this image is the center
};

//
//	Create a marker for the Haunted House
//
var spaceMountainMarker = new google.maps.Marker({
    position: spaceMountain,
    title: "Space Mountain",
    icon: rocketIcon
});

//
//	Create a marker for Space Mountain
//
var hauntedMansionMarker = new google.maps.Marker({
    position: hauntedMansion,
    title: "Haunted Mansion",
    icon: ghostIcon
});

//
//	Create a "circle" object that surrounds the park
//
var parkCircle = new google.maps.Circle({
            strokeColor: '#FF0000',
            strokeOpacity: 1,
            strokeWeight: 2,
            fillColor: '#FF0000',
            fillOpacity: 0,
            center: theHub,
            radius: 500 // radius in meters
          });

//
//	Position the map and set the zoom level
//
map.setCenter(theHub);
map.setZoom(15);

//
//	Attach the circle and markers to the map to display them
//
parkCircle.setMap(map);
spaceMountainMarker.setMap(map);
hauntedMansionMarker.setMap(map);
